import './App.css';

import { Header } from './components/Header';
import { Product } from './components/Product/Product';
import { Slider } from './components/Slider/Slider';

function App() {
  return (
    <>
      <Header />
      <Product />
      <Slider />
    </>
  );
}

export default App;
